import React, { useCallback } from "react";
import { DropdownMenu, MenuItem } from "react-bootstrap-dropdown-menu";
import "../UI/css/SettingMenu.css";
import { logout } from "../utils/auth";

const SettingsMenu = () => {
  const deleteAccount = useCallback((e) => {
    console.log("Deleting Account");
  }, []);

  return (
    <DropdownMenu userName="Chris Smith" style={dropdownMenuStyle}>
      <MenuItem text="Home" location="/home" style={menuItemStyle} />
      <MenuItem text="Edit Profile" location="/profile" style={menuItemStyle} />
      <MenuItem
        text="Change Password"
        location="/change-password"
        style={menuItemStyle}
      />
      <MenuItem
        text="Privacy Settings"
        location="/privacy-settings"
        style={menuItemStyle}
      />
      <MenuItem
        text="Delete Account"
        onClick={deleteAccount}
        style={menuItemStyle}
      />
      <MenuItem text="Logout" onClick={logout} style={menuItemStyle} />
    </DropdownMenu>
  );
};

export default SettingsMenu;
